import Expenses from "./Components/Expenses/Expenses";

const App = () => {
    const expenses = [
        {
            id: 'e1',
            title: 'Toilet paper',
            amount :94.32,
            date: new Date(2020, 1, 12)
        },
        {
            id: 'e2',
            title: 'TV',
            amount :436.90,
            date: new Date(2021, 8, 10)
        },
        {
            id: 'e3',
            title: 'Car Insurance',
            amount :254.77,
            date: new Date(2020, 9, 7)
        },
        {
            id: 'e4',
            title: 'Bicycle',
            amount :1100.00,
            date: new Date(2019, 4, 22)
        },
    ]
  return (
    <div>
      <h2>Let's get started!</h2>
        <Expenses></Expenses>
    </div>
  );
}

export default App;
